  "text" : "\uC5C4\uBC00\uD558\uACE0 \uAF3C\uAF3C\uD558\uACE0 \uBD84\uC11D\uC801\uC778 \uAE30\uC220 \uB204\uC801\uC774 \uAE30\uBCF8\uC124\uACC4 \uC5ED\uB7C9\uC778 \uAC83\uC774\uC9C0, \uD574\uC678\uC5D0\uC11C \uB3C4\uBA74 \uC218\uC785\uD574\uB2E4\uAC00 \uBCA0\uB080\uB2E4\uACE0 \uAC00\uB2A5\uD55C \uAC8C \uC544\uB2C8\uB2E4. \uD574\uC591\uD50C\uB79C\uD2B8\uC5D0\uC11C \uADF8\uB807\uAC8C \uC791\uC0B4\uC774 \uB0AC\uB294\uB370 \uADF8\uB7F0 \uC774\uC57C\uAE30\uB97C \uC81C\uB300\uB85C \uC9DA\uB294 \uC5B8\uB860\uB3C4 \uC5C6\uACE0, \uC220\uC9D1 \uAC70\uB9AC \uD55C\uC0B0\uD558\uB2E4\uB294 \uC774\uC57C\uAE30\uB098 \uD558\uACE0\uC549\uC558\uC73C\uB2C8 \uC5F4\uC774 \uC548\uBC1B\uB098.",
