  "text" : "\uC61B\uB0A0\uC5D0 \uC5B4\uB5A4 \uC5EC\uC131\uC8FC\uC758\uC790\uC5D0\uAC8C \"\uC790\uAFB8 \uBB3C\uC5B4\uBCF4\uB294 \uB0A8\uC790\" \"\uC790\uAFB8 \uC544\uB294 \uCC99\uD558\uB294 \uB0A8\uC790\" \uB458\uB2E4 \uC2EB\uB2E4\uB294 \uC18C\uB9AC\uB97C \uB4E4\uC5C8\uB294\uB370, \uD6C4\uC790\uC57C \uADF8\uB807\uB2E4 \uCCD0\uB3C4 \uC804\uC790\uB294 \uADF8\uB798\uB3C4 \uACF5\uB3D9\uCCB4 \uC548\uC5D0 \uD488\uC5B4\uC57C \uD558\uC9C0 \uC54A\uB098 \uC2F6\uC5C8\uB2E4. \uD55C\uAD6D\uC5D0\uC11C\uB294 \uB0A8\uC790\uB4E4 \uC18D\uC5D0 \uB450\uBA74 \uB458\uC218\uB85D \uAC00\uBD80\uC7A5\uC801 \uC778\uC2DD\uC774 \uB098\uBE60\uC9C8 \uB530\uB984\uC774\uB2E4.",
