  "text" : "\uC560\uCD08\uC5D0 \uB2F9\uC5F0\uD55C \uAC74 \uC5C6\uB2E4. \uC9C0\uC6D0\uC774 \uB2F9\uC5F0\uD558\uB2E4\uB294 \uB9D0\uC774\uB098 \uC9C0\uC6D0\uC774 \uC808\uB300 \uC548 \uB41C\uB2E4\uB294 \uB9D0\uC774\uB098 \uBAA8\uB450 \uADFC\uC790\uAC10\uACFC \uC0C1\uB300\uC801 \uBC15\uD0C8\uAC10\uC5D0\uC11C \uCD9C\uBC1C\uD588\uC744 \uBFD0, \uB0B4\uC801 \uB17C\uB9AC\uB97C \uACE0\uB824\uD55C \uAC83\uC740 \uC5C6\uB2E4. \uC774\uC81C \uC911\uACF5\uC5C5\uC744 \uD544\uB450\uB85C \uAD6C\uC870\uC870\uC815\uC740 \uC9C4\uC9DC \uC2DC\uC791\uC774\uACE0 \uBABB\uC0B4\uB9AC\uBA74 \uD55C\uAD6D\uC758 \uAD74\uB69D\uC0B0\uC5C5\uC740 \uB3C4\uBBF8\uB178\uB85C \uC791\uC0B4\uC774\uB2E4.",
