  "text" : "\uB2E4\uB978 \uC5B4\uB5A4 \uC774\uC998\uC5D0 \uC55E\uC11C \uBBFC\uC8FC\uC8FC\uC758\uC790\uAC00 \uB418\uB824\uD55C\uB2E4. \uBAA8\uB4E0 \uD3ED\uB825\uC5D0 \uB9DE\uC11C\uB418, \uC124\uB4DD\uD558\uB824 \uD560 \uD14C\uACE0 \uC124\uB4DD\uD560 \uC218 \uC788\uB2E4\uACE0 \uC0DD\uAC01\uD558\uBA74\uC11C \uB300\uD654\uD560 \uAC83\uC774\uB2E4. \uC0AC\uB78C\uC774 \uBCC0\uD654\uD560 \uC218 \uC788\uB2E4\uACE0 \uBBFF\uC9C0 \uC54A\uC73C\uBA74 \uBAA8\uB4E0 \uC774\uB860\uC801 \uAE09\uC9C4\uC131\uC740 \uACE7\uBC14\uB85C \uC778\uC885\uC8FC\uC758\uC801\uC778 \uD544\uD130\uAC00 \uB41C\uB2E4. \uAE30\uB3C5\uAD50\uC778\uC73C\uB85C\uC11C \uC2E0\uC559\uB3C4 \uAC19\uB2E4.",
