  "text" : "6-7\uB144\uC804 \uD2B8\uC704\uD130\uC640 \uBE14\uB85C\uACE0\uC2A4\uD53C\uC5B4\uC5D0\uC11C\uB294 \uBD80\uBB38\uACC4\uC5F4\uC6B4\uB3D9(\uCCAD\uB144\uC6B4\uB3D9, \uC5EC\uC131\uC6B4\uB3D9 \uB4F1 \uB2F9\uC0AC\uC790\uC6B4\uB3D9)\uC744 \uAE00\uB85C\uBC8C \uC790\uBCF8\uC8FC\uC758\uB97C \uC720\uC9C0\uD558\uB294 \uCCA8\uBCD1\uC774\uB77C\uBA70 \uC870\uB871\uD558\uB358 \uC774\uB4E4\uC5D0\uAC8C \uB9D0\uD588\uB2E4. \"\uC544, \uD560 \uC77C \uC5C6\uB0D0? \uD55C \uD050\uC5D0 \uC790\uBCF8\uC8FC\uC758 \uC548 \uBB34\uB108\uC838. \uB450\uB9AC\uBC18 \uCE68\uD0C8 \uB2F9\uD560 \uB54C \uAC19\uC774 \uC548 \uC2F8\uC6B8 \uAC70\uB0D0?\"",
